import React from 'react'
import ReactDOM from 'react-dom';
import Sdata from './Sdata';


function Card(Props) {

    return (

        <div className='cards'>
            <div className='card'>
                <img src={Props.imgsrc} alt='' className='card-img' />
                <div className='card-info'>
                    <span className='card-category'>A Netflix Original Series</span>
                    <h3 className='card-title'>{Props.cardTitle}</h3>
                    <a href='#'>
                        <button> Watch Now</button>
                    </a>
                </div>
            </div>
        </div>
    )

}

// function AllDta(val,index,array){
function AllDta(val) {

    return (
        <Card
            imgsrc={val.imgsrc}
            cardTitle={val.cardTitle}
            link={val.link}
        />
    )


}

ReactDOM.render(
    <>

        {Sdata.map(AllDta)}

    </>,
    document.getElementById('root')
);
